type BullshitCommand struct{}

func loadModel() (*gomarkov.Chain, error) {
	var chain gomarkov.Chain
	err := json.Unmarshal([]byte(model), &chain)
	if err != nil {
		return &chain, err
	}
	return &chain, nil
}

func generateBullshit(chain *gomarkov.Chain) []string {
	tokens := []string{gomarkov.StartToken}
	for tokens[len(tokens)-1] != gomarkov.EndToken {
		next, _ := chain.Generate(tokens[len(tokens)-1:])
		tokens = append(tokens, next)
	}

	return tokens
}

func (b BullshitCommand) call(bot *tgbotapi.BotAPI, message *tgbotapi.Message) {
	chain, err := loadModel()

	if err != nil {
		return
	}

	bullshit := generateBullshit(chain)

	response := strings.Join(bullshit[1:len(bullshit)-1], " ")

	msg := tgbotapi.NewMessage(message.Chat.ID, response)
	bot.Send(msg)
}
